import React from 'react';
import styled from 'styled-components';


function ExlporeDropdown(){
    return (
        <div>
            <Title>Explore</Title>
            <Dropdown>
                <li>Stacks</li>
                <li>Queues</li>
                <li>Graphs</li>
                <li>Binary Trees</li>
            </Dropdown>
        </div>
    )
}

export default ExlporeDropdown;
